import React from "react";
import DefaultLayout from "../components/DefaultLayout";
import templateimg from '../resources/templates/template1.png'
import template2img from '../resources/templates/template2.png'
import './../resources/templates.css'
import { useNavigate } from "react-router-dom";

function Home(){
  const navigate=useNavigate();
  const templates=[
    {
      title:'Simple Resume',
      image:templateimg,
    },
    {
      title:'Highlited Section Resume',
      image:template2img,
    }
  ]
    return(
      <DefaultLayout>
       <div className="row home">
         {templates.map((template , index)=>{
          return(
          <div className="col-md-4">
             <div className="template">
             <img src={template.image} height='400' width='300' alt="template"></img>
             <div className="text"> 
              <p>{template.title}</p>
              <button onClick={()=>navigate(`/templates/${index+1}`)}>Try</button>
              </div>
             </div>
          </div>
         );
        })}
       </div>
      </DefaultLayout>
    );
}
export default Home;
